import React from 'react';
import { Link } from 'react-router-dom';
import { useHistory } from 'react-router';

interface Mint {
    id: number;
    name: string;
    description: string;
}

interface MintListComponentProps {
    mints: Mint[];
}

const mockMints: Mint[] = [
    {
        id: 1,
        name: 'Mint 1',
        description: 'This is mint 1',
    },
    {
        id: 2,
        name: 'Mint 2',
        description: 'This is mint 2',
    },
    {
        id: 3,
        name: 'Mint 3',
        description: 'This is mint 3',
    },
];

const MintListComponent: React.FC<MintListComponentProps> = ({ mints }) => {
    const history = useHistory();

    const handleRowClick = (id: number) => {
        // Navigate to MintDetail component with the clicked mint's id
        history.push(`/mint/${id}`);
    };

    return (
        <div>
            <h1>List of Mints</h1>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Description</th>
                    </tr>
                </thead>
                <tbody>
                    {mockMints.map((mint) => (
                        <tr key={mint.id} onClick={() => handleRowClick(mint.id)}>
                            <td>
                                <Link to={`/mint/${mint.id}`}>{mint.name}</Link>
                            </td>
                            <td>{mint.description}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default MintListComponent;
